import { Box, Center, Text, VStack } from "@chakra-ui/react"
import React from "react"

export const Home: React.FC = () => {
  return (
    <Box>
      <VStack bg="blue.100">
        <Center>
          <Text fontSize="20PX">USERS' DASHBOARD</Text>
        </Center>
      </VStack>
    </Box>
  )
}
